import React from 'react';
import '../css/HomePage.css';
import { faUserPlus } from '@fortawesome/free-solid-svg-icons';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faSignInAlt } from '@fortawesome/free-solid-svg-icons';
import { Link } from 'react-router-dom';
import Asset from '../images/Asset.png';




const HomePage = () => {
  return (
    <div className="home-page">
      <div className="left-side">
      <h2>Where Oppotunities and Aspirations Align</h2>
        <p>
         Empowering your journey towards success and fullfillment.Whether you are a recruiter looking for top talents or an individual seeking new opportunities,
          Join us today and unlock the full potential of talent management!
        </p>
      
        {/* <a href="/register" className="cta-button"><FontAwesomeIcon icon={faUserPlus} />Register Now</a>
        <a href="/login" className="cta-button1"><FontAwesomeIcon icon={faSignInAlt} />Login Now</a> */}
        <>
        <Link to="/register" className="cta-button">JobSeeker Register</Link>
        <Link to="/register" className="cta-button">Recruiter Register</Link>
        </>
      </div>
      <div className="right-side">
        
      <img src={Asset} alt="Talent Tracker" />
        
      </div>
      
        
        
        
        
    </div>
  );
};

export default HomePage;
